const Videos = () => {
    const {Videos, Loading, Error} = UseVideoList()
    return (
        <div className={classes.videos}>
           {
            Videos.map((video) => (
            //    <Link to='/' key={video.youtubeID}>
            //        <Video title={video.tilte} id={video.youtubeID} noq={video.noq}/>
            //    </Link>
            video.map((sing) =>{
                console.log(sing)
            })
           ))
           }
           {!Loading && Videos.length === 0 && 
           (<h3>No Data Found!</h3>)
           }
           {
               Error && 
               (<h3>An Error Occured!</h3>)
           }
           {Loading && (<h2>Loading ..</h2>)}
        </div>
    );
}

export default Videos;
